  finished = false,
  carousel_branch = "RaceHistory",
  save_on_exit = false,
  dummy_id = 0,
  index = 1,
  grid_index = 0,
  num_rows = 20,
  node_list_id = 0,
  node_ids = {},
  award_node_ids = {},
  race_history = {},
  showing_awards = false,
  CanExit = function(_ARG_0_)
    return false
  end,
  award_index = 0
}
function Init()
  PlaySfxGraphicNext()
  AddSCUI_Elements()
  DeferCam_Init(UIGlobals.CameraNames.MpLobby)
  CarouselApp_SetScreenTimers()
  net_SetRichPresence(UIEnums.RichPresence.RaceHistory)
  StoreInfoLine()
  UIButtons.TimeLineActive("garage_start", true)
  GUI.race_history = Multiplayer.GetRaceHistory()
  for _FORV_4_ = 1, 10 do
  end
  _FOR_.SetActive(SCUI.name_to_id.award_left_arrow, false)
  UIButtons.SetActive(SCUI.name_to_id.award_right_arrow, false)
  if 0 + 1 == 0 then
    SetupCustomPopup(UIEnums.CustomPopups.NoHistory)
  elseif 0 + 1 == 1 then
    UIButtons.SetActive(SCUI.name_to_id.left_arrow, false)
    UIButtons.SetActive(SCUI.name_to_id.right_arrow, false)
  end
end
function PostInit()
  GUI.dummy_id = SCUI.name_to_id.screen
  GUI.node_title_id = UIButtons.CloneXtGadgetByName("Shared\\RaceHistory.lua", "_node_title")
  UIButtons.AddListItem(SCUI.name_to_id.node_list_title, GUI.node_title_id, 1)
  UIButtons.ChangeText(UIButtons.FindChildByName(GUI.node_title_id, "_text_title_gamertag"), UIText.MP_SCOREBOARD_NAME)
  GUI.node_list_id = UIButtons.FindChildByName(GUI.dummy_id, "node_list")
  for _FORV_5_ = 1, GUI.num_rows do
    GUI.node_ids[_FORV_5_] = UIButtons.CloneXtGadgetByName("Shared\\RaceHistory.lua", "_node_player")
    UIButtons.SetActive(UIButtons.FindChildByName(GUI.node_ids[_FORV_5_], "_background_box"), _FORV_5_ % 2 == 1)
    UIButtons.AddListItem(GUI.node_list_id, GUI.node_ids[_FORV_5_])
  end
  GUI.award_list_id = SCUI.name_to_id.awards_node_list
  for _FORV_5_ = 1, 5 do
    GUI.award_node_ids[_FORV_5_] = InitAward()
    UIButtons.AddListItem(GUI.award_list_id, GUI.award_node_ids[_FORV_5_])
  end
  BuildTable(GUI.index)
  RaceHistory_SetupInfoLines()
end
function MessageUpdate(_ARG_0_, _ARG_1_, _ARG_2_, _ARG_3_, _ARG_4_)
  if SCUI_MessageUpdate(_ARG_0_, _ARG_1_, _ARG_2_, _ARG_3_, _ARG_4_) == true then
    return
  end
  if GUI.finished == true then
    return
  end
  if _ARG_0_ == UIEnums.Message.MenuNext then
    if NetServices.CanViewGamerCard(Profile.GetPrimaryPad()) == true and GUI.showing_awards == false then
      NetServices.ViewRaceSummaryGamerCard(Profile.GetPrimaryPad(), SelectedPlayerIndex(), GUI.race_history[GUI.index].index)
    end
  elseif _ARG_0_ == UIEnums.Message.MenuBack then
    if GUI.showing_awards == true then
      UIButtons.SetActive(SCUI.name_to_id.award_left_arrow, false)
      UIButtons.SetActive(SCUI.name_to_id.award_right_arrow, false)
      UIButtons.TimeLineActive("hide_table", false)
      for _FORV_8_ = 1, 5 do
        UIButtons.PrivateTimeLineActive(GUI.award_node_ids[_FORV_8_], "activate_award", false)
      end
      _FOR_()
    else
      GoScreen("Multiplayer\\MpOnline.lua")
    end
    PlaySfxBack()
    UIButtons.SetActive(GUI.node_list_id, true)
    GUI.showing_awards = false
